import React from "react";
import errorimg from "../media/error.jpg";

function error() {
  return (
    <>
      <div display="inline-block" text-align="center">
        <image src="../media/error.jpg" alt="error" />
        <h2> Oopsies, there was a connection error. </h2>
      </div>
    </>
  );
}

export default error;
